pragma solidity 0.8.10;

import "@openzeppelin/contracts-upgradeable/proxy/utils/Initializable.sol";
import "@openzeppelin/contracts-upgradeable/token/ERC721/ERC721Upgradeable.sol";
import "@openzeppelin/contracts-upgradeable/token/ERC721/extensions/ERC721EnumerableUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/access/OwnableUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/security/ReentrancyGuardUpgradeable.sol";
import "./interfaces/IRandom.sol";
import "./interfaces/IGnomeStats.sol";
import "./interfaces/IPlayerGnome.sol";
import "./interfaces/IGnome.sol";
import "./interfaces/IGnomes.sol";
import "./interfaces/IToken.sol";
import "./interfaces/IMines.sol";


contract Gnomes is Initializable, ERC721Upgradeable, ERC721EnumerableUpgradeable, ReentrancyGuardUpgradeable, OwnableUpgradeable, IGnome, IPlayerGnome {

    /*
         player => collection id => gnome id => token id
     */
    mapping(address => mapping(uint8 => mapping(uint8 => uint))) private _playerCollections;
    /*
        player => collection id => collection power
    */
    mapping(address => mapping(uint8 => uint)) private _playerCollectionsPower;

    structPlayerGnome[] private _playersGnomes;
    structGnome[] private  _gnomes;
    IGnomeStats private _gnomeStatsContract;
    IToken private  _tokenContract;
    IRandom private _randomContract;
    IMines private _minesContract;
    address private _feesAccount;
    string private _baseURIStr;
    uint[] private _mergeCost;
    uint private _mintCost;
    uint64 private _totalBaseGnomesMints;

    event Mint(address indexed account, uint  indexed tokenId, uint8 gnomeId, uint8 level, uint64 totalMints);


    function initialize(address gnomeStatsContract, address tokenContract, address randomContract, address minesContract, address feesAccount, address owner, string memory baseUri) initializer public {
        __ERC721_init("MYMM Gnomes", "MYMMGNOMES");
        __ERC721Enumerable_init();
        __ReentrancyGuard_init();
        __Ownable_init();
        setTokenContractAddress(tokenContract);
        setRandomContractAddress(randomContract);
        setGnomeStatsContractAddress(gnomeStatsContract);
        setMinesContractAddress(minesContract);
        setFeesAccount(feesAccount);
        setMintCost(5 * 1 ether);
        setBaseUri(baseUri);
        // start from 1
        _playersGnomes.push();
        structGnome[] memory gnomes = _gnomeStatsContract.getAllGnomes();
        for (uint i; i < gnomes.length; i++) {
            _gnomes.push(gnomes[i]);
        }
        transferOwnership(owner);

    }

    function getPlayerCollectionsPower(address player, uint8 collectionId) external view returns (uint){
        return _playerCollectionsPower[player][collectionId];
    }

    function getTokenIdByCollectionGnome(address account, uint8 collectionId, uint8 gnomeId) external view returns (uint){
        return _playerCollections[account][collectionId][gnomeId];

    }

    function getGnomeByTokenId(uint tokenId) external view returns (structPlayerGnome memory){
        return _playersGnomes[tokenId];
    }

    function mint(uint8 level) payable public nonReentrant {
        require(level > 0 && level < 6, "level is not in range");
        uint mintPrice = getGnomeMintPrice(level);
        require(msg.value == mintPrice, "Insufficient amount");
        uint64 totalMints = _totalBaseGnomesMints;
        require(totalMints <= 10 ** 6, 'max mints');
        payable(_feesAccount).transfer(msg.value);

        _totalBaseGnomesMints = uint64(totalMints + (2 ** (level - 1)));
        uint randomNumber = _randomContract.getRandomNumber();
        uint8 gnomeId = uint8((randomNumber % _gnomes.length) + 1);
        _createGnome(
            gnomeId,
            1,
            _gnomes[gnomeId].collectionId
        );

    }

    function mergeGnomes(uint tokenId1, uint tokenId2, uint amount) external nonReentrant {

        require(_msgSender() == ownerOf(tokenId1) && _msgSender() == ownerOf(tokenId2), "Owner only");
        require(_playersGnomes[tokenId1].exists && _playersGnomes[tokenId2].exists, "Gnome does not exists");
        uint8 gnomeId = _playersGnomes[tokenId1].gnomeId;
        require(gnomeId == _playersGnomes[tokenId2].gnomeId, "Different gnome");
        uint8 level = _playersGnomes[tokenId1].level;
        require(level == _playersGnomes[tokenId2].level, "Different level");
        require(level < 10, "Max level");
        uint cost = _mergeCost[level - 1];
        require(_mergeCost[level - 1] == amount, "invalid amount");
        uint8 newLevel = _playersGnomes[tokenId1].level + 1;
        _tokenContract.burn(_msgSender(), cost);

        _burn(tokenId1);
        _burn(tokenId2);

        _createGnome(
            gnomeId,
            newLevel,
            _gnomes[gnomeId].collectionId
        );

    }

    function _createGnome(uint8 gnomeId, uint8 level, uint8 collectionId) private {
        uint newTokenId = _playersGnomes.length;
        _safeMint(_msgSender(), newTokenId);
        structPlayerGnome memory playerGnome = structPlayerGnome({
        gnomeId : gnomeId,
        tokenId : newTokenId,
        level : level,
        exists : true
        });
        _playersGnomes.push(playerGnome);
        if (_isGnomeIsHigherLevelThenCurrentCollectionGnome(gnomeId, level, collectionId) == true) {
            _addGnomeToCollection(_msgSender(), newTokenId, gnomeId, level, collectionId);
        }
        emit Mint(_msgSender(), newTokenId, gnomeId, level, _totalBaseGnomesMints);

    }

    function _burn(uint256 tokenId) internal override {
        _playersGnomes[tokenId].exists = false;
        _removeGnomeFromCollection(_msgSender(), tokenId);
        super._burn(tokenId);
    }


    function _addGnomeToCollection(address account, uint tokenId, uint8 gnomeId, uint8 level, uint8 collectionId) private {
        require(_playersGnomes[tokenId].exists, "token does not exists");
        uint oldTokenId = _playerCollections[account][collectionId][gnomeId];
        _playerCollections[account][collectionId][gnomeId] = tokenId;
        uint newPower = _playerCollectionsPower[account][collectionId];
        newPower = newPower + _calcPower(gnomeId, level);
        if (oldTokenId > 0 && _playersGnomes[oldTokenId].exists) {
            newPower = newPower - _calcPower(_playersGnomes[oldTokenId].gnomeId, _playersGnomes[oldTokenId].level);
        }
        _playerCollectionsPower[account][collectionId] = newPower;
    }

    function _removeGnomeFromCollection(address account, uint tokenId) private {
        if (_playersGnomes[tokenId].exists == false) {
            return;
        }
        uint8 gnomeId = _playersGnomes[tokenId].gnomeId;
        uint8 collectionId = _gnomes[gnomeId].collectionId;

        if (_playerCollections[account][collectionId][gnomeId] != tokenId) {
            return;
        }
        _minesContract.claimByAccount(account, collectionId);
        uint collectionPower = _playerCollectionsPower[account][collectionId];

        _playerCollectionsPower[account][collectionId] = collectionPower - _calcPower(gnomeId, _playersGnomes[tokenId].level);
        _playerCollections[account][collectionId][gnomeId] = tokenId;
        _minesContract.claimByAccount(account, collectionId);

    }

    function _calcPower(uint8 gnomeId, uint8 level) private view returns (uint) {
        return _gnomes[gnomeId].basePower * (2 ** level);
    }

    function _isGnomeIsHigherLevelThenCurrentCollectionGnome(uint8 gnomeId, uint8 level, uint8 collectionId) private view returns (bool) {
        uint currentTokenId = _playerCollections[_msgSender()][collectionId][gnomeId];
        if (currentTokenId == 0) {
            return true;
        }
        if (level > _playersGnomes[currentTokenId].level) {
            return true;
        }
        return false;
    }

    function getGnomeMintPrice(uint8 level) public view returns (uint){
        uint price = (2 ** (level - 1)) * _mintCost;
        if (level > 1) {
            price = price * 2;
        }
        return price;
    }

    function _transfer(address from, address to, uint256 tokenId) internal override {
        _removeGnomeFromCollection(from, tokenId);
        super._transfer(from, to, tokenId);
    }

    function _beforeTokenTransfer(address from, address to, uint256 tokenId) internal override(ERC721Upgradeable, ERC721EnumerableUpgradeable) {
        super._beforeTokenTransfer(from, to, tokenId);
    }

    function supportsInterface(bytes4 interfaceId) public view override(ERC721Upgradeable, ERC721EnumerableUpgradeable) returns (bool) {
        return super.supportsInterface(interfaceId);
    }

    function _baseURI() internal view override returns (string memory) {
        return _baseURIStr;
    }

    //********************************* management functions *************************************//

    function setBaseUri(string memory uri) public onlyOwner {
        _baseURIStr = uri;
    }

    function setGnomeStatsContractAddress(address gnomeStatsContract) public onlyOwner {
        _gnomeStatsContract = IGnomeStats(gnomeStatsContract);
    }

    function setTokenContractAddress(address tokenContract) public onlyOwner {
        _tokenContract = IToken(tokenContract);
    }

    function setRandomContractAddress(address randomContract) public onlyOwner {
        _randomContract = IRandom(randomContract);
    }

    function setMinesContractAddress(address minesContract) public onlyOwner {
        _minesContract = IMines(minesContract);
    }

    function setFeesAccount(address feesAccount) public onlyOwner {
        _feesAccount = feesAccount;
    }

    function setMergeCost(uint[] calldata mergeCost) public onlyOwner {
        require(mergeCost.length == 9, 'merge need 9 levels');
        _mergeCost = mergeCost;
    }

    function setMintCost(uint mintCost) public onlyOwner {
        _mintCost = mintCost;
    }
}
